import React, {Component} from 'react';
import data from './data.json';

export default class Display extends React.Component
{
    render(){
        return (
            <table>
                {
                Object.keys(this.props.result).map((key)=>(
                    <h3 key={key}>{key}</h3>
                ))
                }
            </table>            
        )
    }
}
